from befree.api_model.config.headers import Headersfrom befree.api_model.config.internal.default.endpoints import Endpointsfrom befree.api_model.config.internal.default.payloads import Payloadsfrom befree.api_model import apifrom requests import Responseclass Default:    def __init__(self):        self._endpoints = Endpoints()        self._payloads = Payloads()        self._headers = Headers()    def get(self, keys=[]):        response: Response = api.config_internal_session.post(            url=self._endpoints.get_config,            data=self._payloads.get_config(keys=keys),            headers=self._headers.common,        )        return response